import React from 'react';
import Link from 'next/link';
/** @jsx jsx */
/** @jsxFrag React.Fragment */
import { jsx, css } from '@emotion/core';

export default function Signup() {
  return (
    <>
      <form>
        <input placeholder="Name" type="text" required="" />
        <input placeholder="Email" type="email" name="customerEmail" />
        <input
          placeholder="Password"
          type="password"
          name="customerPassword"
          pattern="[0-9]{3}-[0-9]{3}-[0-9]{4}"
        />
        <button type="button"> SIGN UP</button>
      </form>
      <style jsx>{`
        .container {
          min-height: 100vh;
          padding: 0 0.5rem;
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          font-size: 16px;
        }

        h1,
        h2,
        h3,
        h4,
        h5,
        h6,
        label,
        span {
          font-weight: 500;
          font-family: 'Fira Sans', sans-serif;
        }

        body,
        html,
        .App,
        #root,
        .auth-wrapper {
          width: 100%;
          height: 100%;
        }

        .navbar-light {
          background-color: #ffffff;
          box-shadow: 0px 14px 80px rgba(34, 35, 58, 0.2);
        }

        .auth-wrapper {
          display: flex;
          justify-content: center;
          flex-direction: column;
          text-align: left;
        }

        .auth-inner {
          width: 450px;
          margin: auto;
          background: #ffffff;
          box-shadow: 0px 14px 80px rgba(34, 35, 58, 0.2);
          padding: 40px 55px 45px 55px;
          border-radius: 15px;
          transition: all 0.3s;
        }

        .auth-wrapper .form-control:focus {
          border-color: #167bff;
          box-shadow: none;
        }

        .auth-wrapper h3 {
          text-align: center;
          margin: 0;
          line-height: 1;
          padding-bottom: 20px;
        }

        .custom-control-label {
          font-weight: 400;
        }

        .forgot-password,
        .forgot-password a {
          text-align: right;
          font-size: 13px;
          padding-top: 10px;
          color: #7f7d7d;
          margin: 0;
        }

        .forgot-password a {
          color: #167bff;
        }
      `}</style>
    </>
  );
}
